func isMember(userID string, members []MemberItem) bool {
	for _, m := range members {
		if m.UserID == userID {
			return true
		}
	}
	return false
}

func shortResourceID(id string) string {
	if len(id) > 12 {
		return id[:12] + "…"
	}
	return id
}

func resourceTypeIcon(rt string) string {
	switch rt {
	case "stack":
		return "fa-cubes"
	case "container_group":
		return "fa-object-group"
	case "gitea_connection":
		return "fa-code-branch"
	case "s3_connection":
		return "fa-database"
	case "host":
		return "fa-server"
	case "network":
		return "fa-network-wired"
	case "volume":
		return "fa-hdd"
	default:
		return "fa-question"
	}
}

func resourceTypeLabel(rt string) string {
	switch rt {
	case "stack":
		return "Stack"
	case "container_group":
		return "Container Group"
	case "gitea_connection":
		return "Gitea"
	case "s3_connection":
		return "S3"
	case "host":
		return "Host"
	case "network":
		return "Network"
	case "volume":
		return "Volume"
	default:
		return rt
	}
}

// resourcesJSON generates JSON array string for resources
func resourcesJSON(resources []ResourceOption) string {
	if len(resources) == 0 {
		return "[]"
	}
	result := "["
	for i, r := range resources {
		if i > 0 {
			result += ","
		}
		// Escape quotes in names
		name := r.Name
		name = strings.ReplaceAll(name, "\\", "\\\\")
		name = strings.ReplaceAll(name, "\"", "\\\"")
		result += fmt.Sprintf(`{"id":"%s","name":"%s"}`, r.ID, name)
	}
	result += "]"
	return result
}

